// App.js
import React, { useState, useEffect } from 'react';
import { Container, Button, Card, Modal, Form, Alert } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';

const App = () => {
  const [showRegistration, setShowRegistration] = useState(false);
  const [userDetails, setUserDetails] = useState({ email: '', name: '', id: '', phone: '' });
  const [isRegistered, setIsRegistered] = useState(false);
  const [volunteersCount, setVolunteersCount] = useState(0);
  const [volunteersNeeded, setVolunteersNeeded] = useState(10); // Set by the admin

  useEffect(() => {
    // Fetch the current count of registered volunteers from the backend
    axios.get('http://localhost:5000/api/volunteers/count')
      .then(response => {
        setVolunteersCount(response.data.count);
      })
      .catch(error => {
        console.error('Error fetching volunteers count:', error);
      });
  }, []);

  const handleRegistrationSubmit = (e) => {
    e.preventDefault();
    if (volunteersCount < 2 * volunteersNeeded) {
      axios.post('http://localhost:5000/api/volunteers/register', userDetails)
        .then(response => {
          setIsRegistered(true);
          setVolunteersCount(volunteersCount + 1);
          alert('Registered successfully!');
        })
        .catch(error => {
          console.error('Error registering user:', error);
        });
    } else {
      alert('Registration closed.');
    }
    setShowRegistration(false);
  };

  const handleChange = (e) => {
    setUserDetails({ ...userDetails, [e.target.name]: e.target.value });
  };

  return (
    <Container className="mt-4">
      <Card>
        <Card.Img variant="top" src="https://via.placeholder.com/150" alt="Event" />
        <Card.Body>
          <Card.Title>Event Name</Card.Title>
          {isRegistered ? (
            <Alert variant="success">You are already registered for this event.</Alert>
          ) : (
            <>
              {volunteersCount >= 2 * volunteersNeeded ? (
                <Button variant="secondary" disabled>
                  Registration Closed
                </Button>
              ) : (
                <Button variant="primary" onClick={() => setShowRegistration(true)}>
                  Register
                </Button>
              )}
            </>
          )}
        </Card.Body>
      </Card>

      <Modal show={showRegistration} onHide={() => setShowRegistration(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Event Registration</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form onSubmit={handleRegistrationSubmit}>
            <Form.Group controlId="email">
              <Form.Label>Email</Form.Label>
              <Form.Control
                type="email"
                name="email"
                value={userDetails.email}
                onChange={handleChange}
                required
              />
            </Form.Group>

            <Form.Group controlId="name">
              <Form.Label>Name</Form.Label>
              <Form.Control
                type="text"
                name="name"
                value={userDetails.name}
                onChange={handleChange}
                required
              />
            </Form.Group>

            <Form.Group controlId="id">
              <Form.Label>ID</Form.Label>
              <Form.Control
                type="text"
                name="id"
                value={userDetails.id}
                onChange={handleChange}
                required
              />
            </Form.Group>

            <Form.Group controlId="phone">
              <Form.Label>Phone Number</Form.Label>
              <Form.Control
                type="text"
                name="phone"
                value={userDetails.phone}
                onChange={handleChange}
                required
              />
            </Form.Group>

            <Button variant="primary" type="submit" disabled={isRegistered || volunteersCount >= 2 * volunteersNeeded}>
              Submit
            </Button>
          </Form>
        </Modal.Body>
      </Modal>
    </Container>
  );
};

export default App;
